import React from 'react';

export default function Artist({ albums }) {
  return (
    <ul>
      {albums.map((el, idx) => (
        <>
          < li key={idx} > {el.name}</li>
          < li key={idx} > {el.id}</li>
        </>
      ))
      }
    </ul >
  )

}
